create database curecartdb;

use curecartdb;

-- Users Table
CREATE TABLE Users (
    id INT PRIMARY KEY,
    name VARCHAR(100),
    email VARCHAR(100) UNIQUE,
    password VARCHAR(255),
    role VARCHAR(10) CHECK (role IN ('USER', 'ADMIN')),
    created_at DATETIME
);

-- Medicines Table
CREATE TABLE Medicines (
    id VARCHAR(20) PRIMARY KEY,
    name VARCHAR(255),
    price DECIMAL(10,2),
    manufacture_name VARCHAR(255),
    pack_size VARCHAR(100),
    composition TEXT
);



-- Cart Items Table
CREATE TABLE CartItems (
    id INT PRIMARY KEY,
    user_id INT,
    product_id varchar(20),
    quantity INT,
    FOREIGN KEY (user_id) REFERENCES Users(id),
    FOREIGN KEY (product_id) REFERENCES Medicines(id)
);

-- Prescriptions Table
CREATE TABLE Prescriptions (
    id INT PRIMARY KEY,
    user_id INT,
    product_id varchar(20),
    file_path VARCHAR(255),
    status VARCHAR(20) CHECK (status IN ('PENDING', 'APPROVED', 'REJECTED')) DEFAULT 'PENDING',
    uploaded_at DATETIME,
    FOREIGN KEY (user_id) REFERENCES Users(id),
    FOREIGN KEY (product_id) REFERENCES Medicines(id)
);

-- Orders Table
CREATE TABLE Orders (
    id INT PRIMARY KEY,
    user_id INT,
    total_amount DECIMAL(10,2),
    status VARCHAR(20) CHECK (status IN ('PENDING', 'PAID', 'SHIPPED', 'DELIVERED')),
    created_at DATETIME,
    FOREIGN KEY (user_id) REFERENCES Users(id)
);

-- Order Items Table
CREATE TABLE OrderItems (
    id INT PRIMARY KEY,
    order_id INT,
    product_id varchar(20),
    quantity INT,
    price DECIMAL(10,2),
    FOREIGN KEY (order_id) REFERENCES Orders(id),
    FOREIGN KEY (product_id) REFERENCES Medicines(id)
);

